@anguoyang there is no tutorial, but there are a wealth of issues on the topic here. There are two export methods: using ONNX_EXPORT=True and then running detect.py (which is how we build our coreml model for idetection), or simply using the built in pytorch onnx exporter to export a literal copy of the pytorch model.

The pytorch weights we have here [perform](https://github.com/ultralytics/yolov3#map) better than darknet, so theres no point in exporting from darknet I think. 

I'm not sure what TVM is, the iDetection app simply uses pytorch > onnx > coreml pipeline.
